'use strict'

const codepoints = require('./font/bootstrap-icons.json')

module.exports = {
  inputDir: './icons',
  outputDir: './font',
  fontTypes: ['woff2', 'woff'],
  assetTypes: ['css', 'scss', 'json'],
  name: 'bootstrap-icons',
  codepoints,
  prefix: 'bi',
  selector: '.bi',
  fontsUrl: './fonts',
  formatOptions: {
    json: {
      indent: 2
    }
  },
  // Use our custom Handlebars templates
  templates: {
    css: './build/font/css.hbs',
    scss: './build/font/scss.hbs'
  },
  pathOptions: {
    json: './font/bootstrap-icons.json',
    css: './font/bootstrap-icons.css',
    scss: './font/bootstrap-icons.scss',
    woff: './font/fonts/bootstrap-icons.woff',
    woff2: './font/fonts/bootstrap-icons.woff2'
  }
}

{
  "name": "twbs/bootstrap-icons",
  "description": "Official open source SVG icon library for Bootstrap",
  "keywords": [
    "bootstrap",
    "icons",
    "svg",
    "icon font"
  ],
  "homepage": "https://icons.getbootstrap.com/",
  "authors": [
    {
      "name": "Mark Otto",
      "email": "markdotto@gmail.com"
    }
  ],
  "support": {
    "issues": "https://github.com/twbs/icons/issues"
  },
  "license": "MIT"
}

import js from '@eslint/js'
import globals from 'globals'

/** @type {import('eslint').Linter.FlatConfig[]} */
export default [
  // global ignores
  {
    ignores: [
      '**/*.min.js',
      '**/dist/**',
      '**/vendor/**',
      '_site/**',
      'node_modules/**',
      'resources/**',
      '**/.fantasticonrc.js'
    ],
  },
  {
    languageOptions: {
      ecmaVersion: 2020,
      sourceType: 'module',
      globals: {
        ...globals.nodeBuiltin
      }
    },
    linterOptions: {
      reportUnusedDisableDirectives: 'error'
    }
  },
  js.configs.recommended,
  {
    files: [
      '**/*.js',
      '**/*.mjs'
    ],
    rules: {
      'no-return-await': 'error',
      'object-curly-spacing': [
        'error',
        'always'
      ],
      'prefer-template': 'error',
      semi: [
        'error',
        'never'
      ],
      strict: 'error'
    }
  },
  {
    files: [
      'docs/assets/js/**'
    ],
    languageOptions: {
      globals: {
        ...globals.browser
      }
    }
  }
]

